// Pages
import Author from "layouts/pages/landing-pages/author";

const routes = [
  {
    name: "pages",
    columns: 1,
    rowsPerColumn: 1,
    collapse: [
      {
        name: "landing pages",
        collapse: [
          {
            name: "Prediction",
            route: "/pages/landing-pages/author",
            component: <Author />,
          },
        ],
      },
    ],
  },
];

export default routes;
